function getActualData( yData, xData ) {
  if(typeof yData === 'string') {
    yData = JSON.parse(yData)
  }
  var i = 0
  var arr = [];
  //for (var i = 0; i < yData.length; i++) {
  for ( i = 1; i < yData.length; i++) {
    //if(yData[i] !== 0.0) {
      arr.push(yData[i])
    //}
  }
  
  
  var coordinate = []
  for ( i = 0; i < xData.length; i++) {
    coordinate.push({
      x: xData[i],
      y: arr[i] - 600
    })
  }
  return coordinate
}

function formateXAxisData( data ) {
	if(typeof data === 'string') {
    data = JSON.parse(data)
	}
  var arr = [];
  //for (var i = 0; i < data.length; i++) {
    //if (data[i] !== 0.0 || i === 0) {
      //arr.push(data[i])
    //}
  //}
  
  for (var i = 1; i < data.length; i++) {
      arr.push(data[i])
  }
  return arr
}
